When I met @vaishalisstudio at @collectiveindia ‘s Wedding Pop Up I didn’t know I would absorb so much and go back home feeling absolutely inspired. Her collection Breathe was all about the pandemic where people struggled for ‘breath’ and has dedicated it to all the covid warriors who fought hard! She also explained how important breath was when she went under water and how she struggled to catch breathe and her collection is inspired by it and also the beautiful coral reefs she spotted from her underwater adventure. Every piece she makes , she makes sure all the fabric is used or reused into another outfit in some or the other way as she believes in creation and doesn’t like things going waste. After listening to all this , I felt such a deep connection with her and how meaningful it would be wearing a piece by her.. this wedding season, get yourself a Vaishali S outfit ✨✨ [AD]

